지난번 한국에서 받은 좋은 커피들을 뉴욕에서 커핑했었다
그리고 카페쇼 일로 다시 한국을 방문이 결정되었을때 이번엔 뉴욕커피들로 한국에서 커핑하면 어떨까 생각하고 상원씨와 이야기를 했다
결론은 당연히 고
그렇게 스틸커피, 마르코웍스, 메쉬커피에서 총 3번의 커핑시간을 가졌다
나는 사정상 메쉬커피에서의 커핑만 참여하고 나머진 상원씨가 수고해줬다 #고마워요 
그냥 즐기고 싶었다 
커피들을 궁금해하는 사람들에게 어렵지않게 소개하는 좋은 기회니말이다
가져온 커피들의 기준은 뉴욕 로컬 로스터리 카페, 그리고 내 개취 #ㅋㅋㅋㅋㅋ 
메쉬에서 마지막 커핑을 마치고 가위바위보로 남은 커피들 쟁탈전은 아마도 이번 커핑의 하이라이트였는듯
메쉬사장님의 위트덕분에 급 생긴 이벤트라 더 좋았다

나는 커피를 좋아하는 일러스트레이터다 
그래도 커핑을 기획했던 이유는 좋은것을 나누고 싶어서였다
이번 커핑도 커피 종사자들이 아닌 사람들도 많았다고 본다. 문화는 누구나 즐길 수 있다. 그리고 그 문화를 나눌 수 있는 여력과 상황이 되면 하고 싶다
이번에 또 한번 느낀것은 혼자서는 결코 할 수 없었던 것도 다양한 사람들이 모이면 재미나게 할 수 있다는 것
카페쇼도 좋았지만 이런 소소한 시간도 넘나 좋았던 이번 한국 방문이었다
